import React from 'react';
import ReactDOM from 'react-dom';
import Cubetemplate from './components/cubes/Cubetemplate';



const IMAGES = [
  "IMG_5774.jpg",
  "IMG_6305.jpg",
  "IMG_6701.jpg",
  "IMG_6732.jpg",
  "IMG_6795.jpg"
];

const News = () => (
  <div className="container gal">
        {IMAGES.map(image => (
          <Cubetemplate source={image} />
          
          ))}
  </div>
);

export default News;
